  assemblies:
  - ANcpLua.Roslyn.Utilities
  namespace: ANcpLua.Roslyn.Utilities.Models
  summary: Represents a result value paired with associated diagnostics from a source generator operation.
  remarks: >-
    <p>
        This type is designed specifically for use in Roslyn incremental source generators where
        both a result and associated diagnostics need to be propagated through the pipeline.
    </p>

    <p>
        Key design decisions:
    </p>

    <ul><li>
                Uses <xref href="ANcpLua.Roslyn.Utilities.Models.DiagnosticInfo" data-throw-if-not-resolved="false"></xref> instead of <code>Diagnostic</code> because <code>Diagnostic</code>
                contains <code>Location</code> which uses reference equality, breaking incremental generator caching.
            </li><li>
                Diagnostics are stored in an <xref href="ANcpLua.Roslyn.Utilities.EquatableArray%601" data-throw-if-not-resolved="false"></xref> to ensure value-based equality
                comparisons work correctly for the incremental generator's caching mechanism.
            </li><li>
                Implemented as a <code>readonly record struct</code> for optimal performance and correct
                equality semantics.
            </li></ul>
  example: []
  syntax:
    content: 'public readonly record struct ResultWithDiagnostics<T> : IEquatable<ResultWithDiagnostics<T>>'
    typeParameters:
